import React, {Component} from 'react';
import 'isomorphic-fetch';

class Movie extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            show:true,
         }
    }



    render() { 
        return (
            <React.Fragment>
            {
                fetch('https://images-na.ssl-images-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_SY500_CR0,0,337,500_AL_.jpg').then(
                    data => console.log(data.thumbnail)
                )
            }

            </React.Fragment>
        )
    }
}

export default Movie;
